import React, { useState, useEffect } from 'react';
import Loader from '../components/Loader';
import Toptwobutt from '../components/Toptwobuttons';
import Navigationbr from '../components/Navigationbr';
import '../Styles/Home.css'; // Make sure to create this CSS file or update your existing styles.

export default function Home() {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulate data loading or resource fetching
    const timer = setTimeout(() => setLoading(false), 2000); // 2 seconds delay
    return () => clearTimeout(timer); // Cleanup timeout
  }, []);

  return (
    <div>
      {loading ? (
        <Loader />
      ) : (
        <div className="home-section">
          
          <Toptwobutt />
          <Navigationbr />
          <div className="button-center-container">
            <button
              className="custom-button"
              onClick={() => alert('Login button clicked!')}
            >
              Login
            </button>
            <button
              className="custom-button"
              onClick={() => alert('Signup button clicked!')}
            >
              Signup
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
